	async _updateCols(num) {
		this.version = 'v' + num;
		let btn = document.querySelectorAll('.type-switch');
		btn.forEach((e) => {
			e.classList.remove('type-active');
		});
		let t = Number(num) - 1;
		btn[t].classList.add('type-active');
		if (num == 1) {
			this.wrapper.querySelector('#rght').style.display = `none`;
			this.wrapper.querySelector('.packageitem').innerHTML = `${this.v1}`;
		}
		if (num == 2) {
			this.wrapper.querySelector('#rght').style.display = `none`;
			this.wrapper.querySelector('.packageitem').innerHTML = `${this.v2}`;
		}
		if (num == 3) {
			this.wrapper.querySelector('#rght').style.display = `block`;
			this.wrapper.querySelector('.packageitem').innerHTML = `${this.v3}`;
		}
	}
